  true,\n\t\"url\": null,\n\t\"notes\": \"Notice to Data Users: The documentation
  for this data set was provided solely by the Principal Investigator(s) and was not
  further developed, thoroughly reviewed, or edited by NSIDC. Thus, support for this
  data set may be limited.nnThis data set contains Lidar measurements of sea ice in
  the Chukchi and Beaufort Seas of the Arctic Ocean, and of snow cover off the northern
  coast of Alaska, USA. The Lidar data were obtained by the Airborne Topographic Mapper
  (ATM) instrument mounted on a P3 aircraft during three days in March 2006. The data
  set includes airborne laser-ranging data, aircraft attitude, and GPS positioning
  information organized in 32-bit (4-byte) scaled binary format. Also included are
  ASCII text files containing processing scripts, latitude/longitude coordinates,
  and surface elevation corresponding to the ATM data. These data were collected as
  part of the joint in situ and aircraft AMSRIce06 campaign. The total volume of this
  data set is approximately 11 gigabytes. All files are available via FTP.nnThese
  data were collected as part of a validation study for the Advanced Microwave Scanning
  Radiometer - Earth Observing System (AMSR-E). AMSR-E is a mission instrument that
  was launched aboard the NASA Aqua Satellite on 04 May 2002.\",\n\t\"license_title\":
